const App = () => {


  return (
    <BrowserRouter>
      <div className="App">
      <Link to={"./pages/cnts/cnttest"}></Link>
      <Link to={"./pages/cnts/cnttest2"}></Link>
        <Header />
        <div className="banner-sec">
